package pattenPrograms;

public class Patten4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=5;
		 int a=1;
		for(int i=0;i<n;i++)
		{
			for(int j=0;j<n;j++)
			{
			System.out.print(a+" ");
			}
			
			System.out.println();
			a++;
		}

	}

}
